import styled from "styled-components";
const MainLayout = styled.div``;
const LayOut = ({ children }) => {
  return (
    <div>
      <div>
        <ul>
          <li>Logo</li>
          <li>Home</li>
          <li>About me</li>
          <li>Contact me</li>
        </ul>
      </div>
      {children}
    </div>
  );
};

export default LayOut;
